import React from 'react'
import './pos.css'
import possibilityImage from '../../assets/possibility.png'
const Pos = () => {
  return (
    <div classname = "gpt3__possiblity section_padding" id ="possiblity">
      <div className = "gpt3__possibility-image"></div>
      <img src = {possibilityImage} alt = "possibility"></img>
      </div>
      
  )
}

export default Pos
